        Enquanto a Maldio do Peso Eterno  implacvel em suas imposies de tarefas, ela concede  pessoa afetada um mnimo de livre-arbtrio. A vtima pode escolher a ordem em que realiza as tarefas e at mesmo o tipo de atividade que deseja empreender, dentro dos limites impostos pela maldio. Essa capacidade de escolha paradoxalmente intensifica o sofrimento da pessoa, pois ela deve decidir constantemente qual tarefa realizar, sabendo que nunca haver um fim para essa demanda interminvel.
